import React from 'react';
import Card from './Card';

class List extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            list: this.props.list
        }
    }
    render() {
        return (
            <ul class="list-group">
                {this.state.list.map(
                    card => <Card img={card.img} heading={card.heading} description={card.description} key={card._id}/>
                )}
            </ul>
        );
    }
}

export default List;
